import React, { useState } from 'react'

function SignIn() {
    return (
        <form className="register-form">
            <h3>Register</h3>
            <input placeholder="username"></input>
            <input placeholder="password"></input>
            <input placeholder="password confirmation"></input>
        </form>
    )
}

export default SignIn
